import React, {Component} from 'react'


export class ListOwnership extends Component{
 state={ownship: {}}


   componentDidMount(){
    fetch('/publicaciones')
        .then(res => res.json())
        .then(respuesta => {
            const {data} = respuesta
            console.log(data)
            this.setState({ownship:data})
       })
   }


    render(){
        const {data} = this.state
        return (
            <div>
                Listado de Propiedades
                {data.map(prop =>{
                    return(
                        <div key={prop.id}>
                            <h1>Zona: {prop.location}</h1>
                        </div>
                    )
                })}
            </div>
        )
    }
}
